=(function () {
  let result = simplePostClient(
    `query Visits_cleft( $filter: Visits_cleftFilter, $orderby: Visits_cleftorderby ) { Visits_cleft( filter:$filter, limit:100, offset:0, orderby:$orderby ) { typevisitcleft {order, name, label} mg_insertedOn }}`,
    {
      filter: {
        belongsToSubject: { equals: [{ id: belongsToSubject.id }] },
      },
      orderby: { mg_insertedOn: "DESC" },
    }
  );
  let lookUp = {
    visitOne: "visitTwo",
    visitTwo: "visitThree",
    visitThree: "visitFour",
    visitFour: "visitFive ",
    visitFive: "visitSix ",
    visitSix: "visitSeven",
    visitSeven: "visitSeven",
  };

  let nextFollowup = result?. Visits_cleft.find(
    (item) => lookUp[item. typevisitcleft.name] !== undefined
  );

  return {
    name: lookUp[nextFollowup.typevisitcleft.name],
  };
})()

